sys_variable_value.value:
(function execute(inputs, outputs) {
    if (inputs.eventId.trim().length == 0) {
        throw "Error while updating Event, invalid inputs have been passed.";
    }
    outputs.calendar_id = inputs.calendarId.trim() || "primary";
    outputs.event_id = inputs.eventId.trim();
    var attendeesToRemove = inputs.attendeesToRemove,
        util = new GoogleHangoutsMeetUtil();
    if (attendeesToRemove.length == 0) {
        throw "Invalid inputs have been passed to action. Attendees to remove is empty";
    }
    attendeesToRemove.forEach(function(item) {
        item = item.trim();
        if (item.length == 0) {
            return;
        }
        if (item.length < 5 || !util.isValidEmailAddress(item)) {
            throw "Invalid email address has been passed as input: " + item;
        }
    }, this);
    var attendees = inputs.existingAttendees || [],
        len = attendees.length,
        email = "",
        count = attendeesToRemove.length;
    for (var i = 0; i < len && count > 0; i++) {
        email = attendees[i] && attendees[i]['email'];
        if (email && attendeesToRemove.indexOf(email) != -1) {
            attendees.splice(i, 1);
            count -= 1;
        }
    }
    outputs.attendees = JSON.stringify(attendees);
})(inputs, outputs);

